BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "users" (
	"id"	INTEGER,
	"username"	TEXT NOT NULL DEFAULT 'username',
	"password"	TEXT NOT NULL DEFAULT 'password',
	"firstName"	TEXT NOT NULL DEFAULT 'name',
	"lastName"	TEXT NOT NULL DEFAULT 'lastName',
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "subject" (
	"id"	INTEGER NOT NULL,
	"naziv"	TEXT NOT NULL,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "note" (
	"id"	INTEGER NOT NULL,
	"predmetId"	INTEGER NOT NULL,
	"korisnikId"	INTEGER NOT NULL,
	"name"	TEXT NOT NULL UNIQUE,
	"textBiljeske"	TEXT,
	"dateCreated"	TEXT,
	"lastModified"	TEXT,
	"favorite"	INTEGER,
	PRIMARY KEY("id"),
	FOREIGN KEY("korisnikId") REFERENCES "users"("id"),
	FOREIGN KEY("predmetId") REFERENCES "subject"("id")
);
INSERT INTO "users" ("id","username","password","firstName","lastName") VALUES (1,'user','user','User','User');
INSERT INTO "subject" ("id","naziv") VALUES (1,'General');
INSERT INTO "note" ("id","predmetId","korisnikId","name","textBiljeske","dateCreated","lastModified","favorite") VALUES (1,1,1,'E-Notes101eng','<html dir="ltr"><head></head><body contenteditable="true"><p><br></p><h1 style="text-align: center;"><span style="font-size: xx-large; font-family: Arial;">E-Notes 101</span></h1><p style="text-align: left;"><span style="font-family: Arial;">E-Notes is an application for keeping lecture notes. In this note you can find out how to use the application.</span></p><p style="text-align: left;"><br></p><p style="text-align: left;"><span style="font-family: Arial;">After successful login you''ll see the main screen.</span></p><p style="text-align: left;"><span style="font-family: Arial;"><img src="data:image/jpeg;base64," type="image/jpeg"><br></span></p><p style="text-align: left;"><span style="font-family: Arial;">&nbsp;On the center you''ll see all of your notes. On the left side is search section with filters for searching. You can combine multiple filter options to search more effectively. If you clear filters and click on the search button, every note will be shown. On the right side are 3 buttons: Add note, Remove and Add Subject.</span></p><p style="text-align: left;"><span style="font-family: Arial;">Add note creates a new note and opens text editor.&nbsp;</span></p><p style="text-align: left;"><span style="font-family: Arial;">Remove button removes selected note. If nothing is selected the button is disabled.&nbsp;</span></p><p style="text-align: left;"><span style="font-family: Arial;">Lastly, Add Subject button opens a new window where you can add a new subject for notes.&nbsp;</span></p><p style="text-align: left;"><span style="font-family: Arial;">Selecting note and pressing Enter or double clicking on the note also opens the note in text editor. The text editor is equipped with some basic options for text editing. You can also insert an image by pressing the "+" button. Unfortunately you can''t manipulate images, and we recommend inserting small sized images.</span></p><p style="text-align: left;"><span style="font-family: Arial;">One of the main options of this aplication is the ability to export notes to your PC which you can print later. The exported file is in pdf format. Export option is located in File-&gt;Export as PDF... or you can just press Shift+E.</span></p><p style="text-align: left;"><span style="font-family: Arial;"><img src="data:image/jpeg;base64," type="image/jpeg"><br></span></p><p style="text-align: left;"><span style="font-family: Arial;">If you want to change application theme you can do that from the main window. Go to View-&gt;Theme and select the theme you want to apply.</span></p><p style="text-align: left;"><img src="data:image/jpeg;base64," type="image/jpeg"><br></p><p style="text-align: left;"><span style="font-family: Arial;">Above is an example of an application window in dark theme.</span></p><p style="text-align: left;"><span style="font-family: Arial;">Also if you want to change the language you can do so with View-&gt; Language and select the desired language.</span></p><p style="text-align: left;"><span style="font-family: Arial;"><br></span></p><p style="text-align: left;"><span style="font-family: Arial;">Have fun using the application.</span></p><p style="text-align: left;"><span style="font-family: Arial;"><br></span></p></body></html>','17.08.21 18:19','17.08.21 19:31',1);
INSERT INTO "note" ("id","predmetId","korisnikId","name","textBiljeske","dateCreated","lastModified","favorite") VALUES (2,1,1,'E-Notes101bos','<html dir="ltr"><head></head><body contenteditable="true"><h1 style="text-align: center;"><span style="font-family: Arial;">E-Notes 101</span></h1><p><span style="font-family: Arial;">E-bilješke je aplikacija za čuvanje bilješki s predavanja. U ovoj bilješci možete saznati kako koristiti aplikaciju.</span></p><p></p><p><span style="font-family: Arial;">Nakon uspješne prijave vidjet ćete glavni zaslon.</span></p><p><span style="font-family: Arial;"><img src="data:image/jpeg;base64," type="image/jpeg"><br></span></p><p><span style="font-family: Arial;">U sredini ćete vidjeti sve svoje bilješke. S lijeve strane nalazi se odjeljak za pretraživanje s filterima za pretraživanje. Možete kombinirati više filtera za učinkovitije pretraživanje. Ako obrišete filtere i kliknete dugme za pretraživanje, prikazat će se svaka bilješka. S desne strane nalaze se 3 dugmeta: Dodaj bilješku, Ukloni i Dodaj predmet.</span></p><p></p><p><span style="font-family: Arial;">Dodavanje bilješke stvara novu bilješku i otvara uređivač teksta.</span></p><p><span style="font-family: Arial;">Gumb Ukloni uklanja odabranu bilješku. Ako ništa nije odabrano, gumb je onemogućen.</span></p><p><span style="font-family: Arial;">Na kraju, gumb Dodaj temu otvara novi prozor u koji možete dodati novu temu za bilješke.</span></p><p><span style="font-family: Arial;">Odabirom bilješke i pritiskom na Enter ili dvostrukim klikom na bilješku također se otvara bilješka u uređivaču teksta. Uređivač teksta opremljen je nekim osnovnim opcijama za uređivanje teksta. Također možete umetnuti sliku pritiskom na dugme "+". Nažalost, ne možete manipulirati slikama, pa preporučujemo umetanje slika male veličine.</span></p><p><span style="font-family: Arial;">Jedna od glavnih opcija ove aplikacije je mogućnost izvoza bilješki na računalo koje možete kasnije isprintati. Izvezena datoteka je u pdf formatu. Opcija izvoza nalazi se u File-&gt; Izvezi kao PDF ... ili možete jednostavno pritisnuti Shift+E.</span></p><p><span style="font-family: Arial;"><img src="data:image/jpeg;base64," type="image/jpeg"><br></span></p><p><span style="font-family: Arial;">Ako želite promijeniti temu aplikacije, to možete učiniti u glavnom prozoru. Idite na View-&gt; Tema i odaberite temu koju želite primijeniti.</span></p><p><span style="font-family: Arial;"><img src="data:image/jpeg;base64," type="image/jpeg"><br></span></p><p><span style="font-family: Arial;">Gore je primjer prozora aplikacije u tamnoj temi.&nbsp;</span></p><p><span style="font-family: Arial;">Također ukoliko želite promijeniti jezik to mozete uraditi sa View-&gt; Jezik te odaberete željeni jezik.</span></p><p><span style="font-family: Arial;"><br></span></p><p><span style="font-family: Arial;">Ugodno korištenje aplikacije.</span></p><p><span style="font-family: Arial;"><br></span></p></body></html>','17.08.21 18:21','17.08.21 19:30',1);
COMMIT;
